// SPDX-License-Identifier: Unlicensed
pragma solidity >=0.5.0;
pragma experimental ABIEncoderV2;

import '../interfaces/IERC20.sol';
import "../open/utils/Initializable.sol";
import "../open/token/ERC721/IERC721.sol";
import "../open/token/ERC721/utils/ERC721Holder.sol";
import "../open/utils/Ownable.sol";


contract Nmarket is ERC721Holder,Initializable,Ownable{

    IERC721 public nToken;
    IERC20 public payToken;

    ////////////////////////////////一口价/////////////////////////

    uint public ORDER_ID = 100000;

    struct Order{
        uint id;            //订单ID
        address seller;     //卖家
        uint price;         //价格
        uint nftId;         //
        address buyer;      //买家
    }

    mapping( uint => Order) public fixedOrderMap;  //订单信息

    uint[] fixedIds;    //全网列表
    // id =》 index
    mapping(uint => uint) public fixedId2Index; 

    // owner => ids
    mapping(address => uint[]) userFixedIds;    //我的列表

    // id =》 index
    mapping(uint => uint) public userFixedId2Index;

    uint public fixedOrderFee =  5;

    ////////////////////////////////竞拍/////////////////////////

    constructor() public {}

    function initialize(
        address _nToken,
        address _payToken,
        address _ownerAddress
    ) public initializer {
        nToken = IERC721(_nToken);
        payToken = IERC20(_payToken);
        _owner = _ownerAddress;
        fixedOrderFee = 5;
        ORDER_ID = 10000;
    }


    //用户订单
    function userFixedOrders()external view returns(Order[] memory _orders){

        uint[] storage ids = userFixedIds[msg.sender];

        uint len = ids.length;

        _orders = new Order[](len);

        for( uint i = 0; i < len; i++){
            _orders[i] = fixedOrderMap[ids[i]];
        }
    }

    //全网订单
    function fixedOrders(uint start,uint end)external view returns(Order[] memory _orders,uint count){

        count = fixedIds.length;

        if( count > 0){
            if( end > count ) end = count - 1;

            if( end >= start ){

                uint size = end - start + 1;

                _orders = new Order[](size);

                for( (uint i,uint k) = (start,0); i <= end && k < size; (i++,k ++) ){
                    _orders[k] = fixedOrderMap[fixedIds[i]];
                }
            }
        } 
    }

    //卖出
    function sellFixedNft(uint nftId,uint price)external{

        nToken.safeTransferFrom(msg.sender,address(this),nftId);

        uint[] storage myIds = userFixedIds[msg.sender];

        require(myIds.length <= 5,"too many order");

        uint id = ORDER_ID;

        fixedOrderMap[id] = Order(id,msg.sender,price,nftId,address(0));

        //全局订单数据
        uint len = fixedIds.length;
        if( len == 0 ){
            fixedIds.push(0);
            len += 1;
        }
        fixedIds.push(id);
        fixedId2Index[id] = len;

        //个人订单数据
        len = myIds.length;
        if( len == 0 ){
            myIds.push(0);
            len += 1;
        }
        myIds.push(id);
        userFixedId2Index[id] = len;

        ORDER_ID ++;
        return;
    }

    //修改订单
    function cancleFixedNft(uint orderId)external{

        Order storage order = fixedOrderMap[orderId];

        require(order.buyer == address(0),"buyed");

        _updateOrder(order.id,order.seller);

        nToken.safeTransferFrom(address(this),order.seller,order.nftId);
    }

    //购买
    function buyFixedNft(uint orderId)external{

        Order storage order = fixedOrderMap[orderId];
        require(order.buyer == address(0),"buyed");

        uint fee = order.price * fixedOrderFee / 100;
        uint v = order.price - fee;
        payToken.transferFrom(msg.sender, order.seller, v);

        order.buyer = msg.sender;

        nToken.safeTransferFrom(address(this),msg.sender,order.nftId);
        _updateOrder(orderId,order.seller);
    }

    function _updateOrder(uint orderId,address owner)internal{

        uint len1 = fixedIds.length;
        uint index1 = fixedId2Index[orderId];

        require(index1 > 0,"not exist");

        fixedIds[index1] = fixedIds[len1-1];
        delete fixedIds[len1 - 1];
        fixedIds.pop();

        if( index1 != len1 - 1 ){
            fixedId2Index[fixedIds[index1]] = index1;
        }

        uint[] storage ids = userFixedIds[owner];

        uint len2 = ids.length;

        uint index2 = userFixedId2Index[orderId];

        ids[index2] = ids[len2 - 1];
        delete userFixedIds[owner][len2 - 1];
        userFixedIds[owner].pop();

        if( index2 != len2 - 1){
            userFixedId2Index[ids[index2]] = index2;
        }
    }
}
